import React from "react";

import { TextField, Button, FormControl } from "@material-ui/core";

export const Login = () => {
  return (
    <form>
      <FormControl>
        <TextField />
      </FormControl>
      <FormControl>
        <TextField type="password" />
      </FormControl>
      <Button color="primary">Login</Button>
    </form>
  );
};
